DROP TABLE IF EXISTS `bus_schedule_bus_types`;

CREATE TABLE `bus_schedule_bus_types` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `seats_map` varchar(255) DEFAULT NULL,
  `seats_count` int DEFAULT NULL,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_options`;

CREATE TABLE `bus_schedule_options` (
  `foreign_id` int unsigned NOT NULL DEFAULT '0',
  `key` varchar(255) NOT NULL DEFAULT '',
  `tab_id` tinyint unsigned DEFAULT NULL,
  `value` text,
  `label` text,
  `type` enum('string','text','int','float','enum','bool') NOT NULL DEFAULT 'string',
  `order` int unsigned DEFAULT NULL,
  `is_visible` tinyint unsigned DEFAULT '1',
  `style` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`foreign_id`,`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_route_details`;

CREATE TABLE `bus_schedule_route_details` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `route_id` int unsigned DEFAULT NULL,
  `from_location_id` int DEFAULT NULL,
  `to_location_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `route_id` (`route_id`,`from_location_id`,`to_location_id`),
  KEY `from_location_id` (`from_location_id`),
  KEY `to_location_id` (`to_location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_seats`;

CREATE TABLE `bus_schedule_seats` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `bus_type_id` int unsigned DEFAULT NULL,
  `width` smallint unsigned DEFAULT NULL,
  `height` smallint unsigned DEFAULT NULL,
  `top` smallint unsigned DEFAULT NULL,
  `left` smallint unsigned DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bus_type_id` (`bus_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_routes`;

CREATE TABLE `bus_schedule_routes` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_tickets`;

CREATE TABLE `bus_schedule_tickets` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `bus_id` int unsigned DEFAULT NULL,
  `seats_count` int unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bus_id` (`bus_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_bookings`;

CREATE TABLE `bus_schedule_bookings` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uuid` int unsigned DEFAULT NULL,
  `bus_id` int unsigned DEFAULT NULL,
  `pickup_id` int unsigned DEFAULT NULL COMMENT 'Location ID',
  `return_id` int unsigned DEFAULT NULL COMMENT 'Location ID',
  `is_return` enum('T','F') DEFAULT 'F',
  `back_id` int unsigned DEFAULT NULL,
  `return_date` date DEFAULT NULL,
  `booking_date` date DEFAULT NULL,
  `bus_departure_date` date DEFAULT NULL,
  `booking_time` varchar(255) DEFAULT NULL,
  `booking_route` varchar(255) DEFAULT NULL,
  `booking_datetime` datetime DEFAULT NULL,
  `stop_datetime` datetime DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  `sub_total` decimal(9,2) unsigned DEFAULT NULL,
  `tax` decimal(9,2) unsigned DEFAULT NULL,
  `total` decimal(9,2) unsigned DEFAULT NULL,
  `deposit` decimal(9,2) unsigned DEFAULT NULL,
  `payment_method` enum('paypal','authorize','creditcard','cash','bank') DEFAULT NULL,
  `status` enum('confirmed','cancelled','pending') DEFAULT 'pending',
  `txn_id` varchar(255) DEFAULT NULL,
  `processed_on` datetime DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `is_sent` enum('T','F') DEFAULT 'F',
  `ip` varchar(255) DEFAULT NULL,
  `c_title` varchar(255) DEFAULT NULL,
  `c_fname` varchar(255) DEFAULT NULL,
  `c_lname` varchar(255) DEFAULT NULL,
  `c_phone` varchar(255) DEFAULT NULL,
  `c_email` varchar(255) DEFAULT NULL,
  `c_company` varchar(255) DEFAULT NULL,
  `c_notes` text,
  `c_address` varchar(255) DEFAULT NULL,
  `c_city` varchar(255) DEFAULT NULL,
  `c_state` varchar(255) DEFAULT NULL,
  `c_zip` varchar(255) DEFAULT NULL,
  `c_country` int unsigned DEFAULT NULL,
  `cc_type` blob,
  `cc_num` blob,
  `cc_exp` blob,
  `cc_code` blob,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid` (`uuid`),
  KEY `bus_id` (`bus_id`),
  KEY `pickup_id` (`pickup_id`),
  KEY `return_id` (`return_id`),
  KEY `booking_date` (`booking_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_cities`;

CREATE TABLE `bus_schedule_cities` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_roles`;

CREATE TABLE `bus_schedule_roles` (
  `id` tinyint unsigned NOT NULL AUTO_INCREMENT,
  `role` varchar(255) DEFAULT NULL,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_bookings_seats`;

CREATE TABLE `bus_schedule_bookings_seats` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `booking_id` int DEFAULT NULL,
  `seat_id` int DEFAULT NULL,
  `ticket_id` int DEFAULT NULL,
  `start_location_id` int DEFAULT NULL,
  `end_location_id` int DEFAULT NULL,
  `is_return` enum('T','F') NOT NULL DEFAULT 'F',
  PRIMARY KEY (`id`),
  UNIQUE KEY `booking_id_2` (`booking_id`,`seat_id`,`ticket_id`,`start_location_id`),
  KEY `booking_id` (`booking_id`),
  KEY `seat_id` (`seat_id`),
  KEY `ticket_id` (`ticket_id`),
  KEY `start_location_id` (`start_location_id`),
  KEY `end_location_id` (`end_location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_routes_cities`;

CREATE TABLE `bus_schedule_routes_cities` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `route_id` int unsigned DEFAULT NULL,
  `city_id` int unsigned DEFAULT NULL,
  `order` tinyint DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `route_id` (`route_id`,`city_id`,`order`),
  KEY `city_id` (`city_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_bookings_tickets`;

CREATE TABLE `bus_schedule_bookings_tickets` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `booking_id` int DEFAULT NULL,
  `ticket_id` int DEFAULT NULL,
  `qty` int DEFAULT NULL,
  `amount` decimal(9,2) DEFAULT NULL,
  `is_return` enum('T','F') NOT NULL DEFAULT 'F',
  PRIMARY KEY (`id`),
  UNIQUE KEY `booking_id` (`booking_id`,`ticket_id`),
  KEY `ticket_id` (`ticket_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_multi_lang`;

CREATE TABLE `bus_schedule_multi_lang` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `foreign_id` int unsigned DEFAULT NULL,
  `model` varchar(50) DEFAULT NULL,
  `locale` tinyint unsigned DEFAULT NULL,
  `field` varchar(50) DEFAULT NULL,
  `content` text,
  `source` enum('script','plugin','data') DEFAULT 'script',
  PRIMARY KEY (`id`),
  UNIQUE KEY `foreign_id` (`foreign_id`,`model`,`locale`,`field`),
  KEY `foreign_key` (`foreign_id`),
  KEY `model` (`model`),
  KEY `locale` (`locale`),
  KEY `field` (`field`)
) ENGINE=InnoDB AUTO_INCREMENT=3031 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_buses_locations`;

CREATE TABLE `bus_schedule_buses_locations` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `bus_id` int unsigned DEFAULT NULL,
  `location_id` int unsigned DEFAULT NULL,
  `departure_time` time DEFAULT NULL,
  `arrival_time` time DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `bus_id` (`bus_id`,`location_id`),
  KEY `location_id` (`location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_bookings_payments`;

CREATE TABLE `bus_schedule_bookings_payments` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `booking_id` int unsigned DEFAULT NULL,
  `payment_method` enum('paypal','authorize','creditcard','bank','cash') DEFAULT NULL,
  `payment_type` varchar(255) DEFAULT NULL,
  `amount` decimal(9,2) unsigned DEFAULT NULL,
  `status` enum('paid','notpaid') DEFAULT 'paid',
  PRIMARY KEY (`id`),
  KEY `booking_id` (`booking_id`),
  KEY `status` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_buses`;

CREATE TABLE `bus_schedule_buses` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `route_id` int unsigned DEFAULT NULL,
  `bus_type_id` int unsigned DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `departure_time` time DEFAULT NULL,
  `arrival_time` time DEFAULT NULL,
  `recurring` varchar(255) DEFAULT NULL,
  `set_seats_count` enum('T','F') DEFAULT 'F',
  `discount` decimal(9,2) DEFAULT '0.00',
  PRIMARY KEY (`id`),
  KEY `route_id` (`route_id`),
  KEY `bus_type_id` (`bus_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_buses_dates`;

CREATE TABLE `bus_schedule_buses_dates` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `bus_id` int unsigned DEFAULT NULL,
  `date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `bus_id` (`bus_id`,`date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_fields`;

CREATE TABLE `bus_schedule_fields` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `key` varchar(100) DEFAULT NULL,
  `type` enum('backend','frontend','arrays') DEFAULT NULL,
  `label` varchar(255) DEFAULT NULL,
  `source` enum('script','plugin') DEFAULT 'script',
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `key` (`key`)
) ENGINE=InnoDB AUTO_INCREMENT=1825 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_prices`;

CREATE TABLE `bus_schedule_prices` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `bus_id` int unsigned DEFAULT NULL,
  `ticket_id` int unsigned DEFAULT NULL,
  `from_location_id` int DEFAULT NULL,
  `to_location_id` int DEFAULT NULL,
  `price` decimal(9,2) DEFAULT NULL,
  `is_return` enum('T','F') NOT NULL DEFAULT 'F',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ticket_id` (`ticket_id`,`from_location_id`,`to_location_id`),
  KEY `bus_id` (`bus_id`),
  KEY `from_location_id` (`from_location_id`),
  KEY `to_location_id` (`to_location_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_users`;

CREATE TABLE `bus_schedule_users` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `role_id` int unsigned NOT NULL,
  `email` varchar(255) DEFAULT NULL,
  `password` blob,
  `name` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `created` datetime NOT NULL,
  `last_login` datetime DEFAULT NULL,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  `is_active` enum('T','F') NOT NULL DEFAULT 'F',
  `ip` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  KEY `role_id` (`role_id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_paypal`;

CREATE TABLE `bus_schedule_plugin_paypal` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `foreign_id` int unsigned DEFAULT NULL,
  `subscr_id` varchar(25) DEFAULT NULL,
  `txn_id` varchar(25) DEFAULT NULL,
  `txn_type` varchar(50) DEFAULT NULL,
  `mc_gross` decimal(9,2) unsigned DEFAULT NULL,
  `mc_currency` varchar(3) DEFAULT NULL,
  `payer_email` varchar(255) DEFAULT NULL,
  `dt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `fid` (`foreign_id`,`subscr_id`,`txn_id`,`txn_type`),
  UNIQUE KEY `txn_id` (`txn_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_locale`;

CREATE TABLE `bus_schedule_plugin_locale` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `language_iso` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `name` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `flag` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `dir` enum('ltr','rtl') CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT 'ltr',
  `sort` int unsigned DEFAULT NULL,
  `is_default` tinyint unsigned DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `language_iso` (`language_iso`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_locale_languages`;

CREATE TABLE `bus_schedule_plugin_locale_languages` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `iso` varchar(20) DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  `region` varchar(255) DEFAULT NULL,
  `native` varchar(255) DEFAULT NULL,
  `dir` enum('ltr','rtl') DEFAULT 'ltr',
  `country_abbr` varchar(3) DEFAULT NULL,
  `language_abbr` varchar(3) DEFAULT NULL,
  `file` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `iso` (`iso`)
) ENGINE=InnoDB AUTO_INCREMENT=260 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_country`;

CREATE TABLE `bus_schedule_plugin_country` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `alpha_2` varchar(2) DEFAULT NULL,
  `alpha_3` varchar(3) DEFAULT NULL,
  `status` enum('T','F') NOT NULL DEFAULT 'T',
  PRIMARY KEY (`id`),
  UNIQUE KEY `alpha_2` (`alpha_2`),
  UNIQUE KEY `alpha_3` (`alpha_3`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=250 DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_one_admin`;

CREATE TABLE `bus_schedule_plugin_one_admin` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `password` blob,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_log`;

CREATE TABLE `bus_schedule_plugin_log` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) DEFAULT NULL,
  `function` varchar(255) DEFAULT NULL,
  `value` text,
  `created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_log_config`;

CREATE TABLE `bus_schedule_plugin_log_config` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


DROP TABLE IF EXISTS `bus_schedule_plugin_sms`;

CREATE TABLE `bus_schedule_plugin_sms` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `number` varchar(255) DEFAULT NULL,
  `text` varchar(255) DEFAULT NULL,
  `status` varchar(255) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;


