INSERT INTO `bus_schedule_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('721', '318', 'pjField', '1', 'title', 'The route represents the start (departure) and the final (arrival) location of a bus trip and all intermediate stops. To create a route, give it a title and add all the locations (bus stops) it has, starting with its start / departure location (Location 1) and adding as many location as you need using the "Add +" button. The last location you create will be the final (arrival) location. You can delete locations or re-order them using the icons that show at the end of each location row on mouse over.', 'script');
