INSERT INTO `bus_schedule_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('943', '551', 'pjField', '1', 'title', 'Use the form below to create new bus type. You can upload and manage a seats map for the bus type. This will let your customers to select specific bus seats on the seats map at Tickets step during the booking process.   To upload a seats map use the browse button below and click on "Save" button. Only images in jpeg file format are acceptable. Once you upload and save you will be redirected to a page where you can manage the seats map and make it active for users. If you don''t want to use a seats map then you need to define the number of seats available for this bus type. In this case the system will automatically assign available seats to each booking and ticket.', 'script');
