INSERT INTO `bus_schedule_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('958', '556', 'pjField', '1', 'title', 'Use the form below to edit the selected bus type. If you have uploaded a seat map you can either delete it (then you will have to set the "Number of seats" value) or manage it. To make the map active for users you need to set the available seats on the map. Just click on the map and a blue rectangle titled "1" will show. You can place the rectangle where appropriate via drag&drop. You can also change its size: point the cursor at rectangle''s angle, click and drag to the size you need. The rectangle added represents one seat on the map. Customers will be able to select seats by clicking on these rectangles at Tickets step during the booking process. You can add as many rectangles as your bus type has. The system will automatically count the number of seats this bus type has after saving the changes. To delete a rectangle click on it and Delete button will show below the map.', 'script');
