INSERT INTO `bus_schedule_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('1276', '796', 'pjField', '1', 'title', 'Use the form below to set your payment and booking process options. It is important to define the deposit payment setting if you enable online payments, because this setting will define the amount that customers will be charged online. You can choose between several online payment methods and/or enable cash payments. If customers choose Cash payment method then the booking will be accepted without any online payment processing. Note that in this case the new booking status will still be as per "Status of new bookings that are not paid" setting. So if status is Pending and you do not confirm the booking, the seats reserved for this booking will be available for booking by other customers after "Seats Pending Time" expires.', 'script');
