INSERT INTO `bus_schedule_multi_lang` (`id`, `foreign_id`, `model`, `locale`, `field`, `content`, `source`) VALUES('1519', '1117', 'pjField', '1', 'title', 'Here you can see a list of buses that will departure today or the date selected by you. You can filter the list of buses by routes. You can also sort the list using the arrows into each column header. "FT Tickets" stands for the number of full trip tickets sold. "Total Tickets" stands for the total number of tickets sold for this bus / trip. You can directly add new booking for a selected bus using the "Add booking" button. You can view more details about the bus / trip or start some actions using the arrow next to "Add booking" button.', 'script');
